@Erick Tavares So, I have close to 18K images generated as of now. I have on my private discord server a tab where I keep queries that hepled chatGPT understand what I mean when I ask "Give me a text2img prompt of ...". 

Usually, just starting the conversation with "here are a couple examples of text2img prompts:", and then you show like 3 good examples you want it to follow. 

Usually, after that, if you ask for a prompt, it works. If you are using a prompt engine that can use weights on words, you can specify a range of values, and it usually works really well after that.

