@Pixelarter 
Not really, no, for now it would be better to have a smaller network serve the API function for the user while transfer reinforcement teaching a secondary model while querying the first large network to give the users a greater degree of freedom while interacting with the network. Main net just forwards the  inputs to user network and queries the secondary network and the user network forwards its outputs via a moderated link to a secondary network, moderator either chooses to take the user network output as a proper reinforcement or keeps the original answer of the main network, while the user gets to reinforce the user network on his own. 

Both the user and the user network could get rewarded for that by more tokens or such.

@David Rios 
Actually, no. There generally a couple of approaches to improving AI and there is at least one that involves more AI and a comminication environment where these neural networks can learn from each other, which would require a general sort of intelligence to play a mediator role, but it can also be done with algorithms and notneccessarily a general AI, but it also doesn't mean the neural network would be 'trained' the same way it was. More likely, specialized in its own branch. But again, it is possible to create a neural network that communicates with these specialized NNs, although it wouldn't be GPT anymore, I dont think.

Joseph Suarez is currently working on something similar in essence that he's created this environment for different neural agents to compete. Shoutout to that guy. NeuralMMO it is called

